  "text" : "\uCDA9\uB3D9\uC870\uC808\uC774 \uC548 \uB3FC \uC0AC\uD68C\uC801\uC73C\uB85C\uB3C4 \uC704\uD5D8\uD558\uB2E4. \u2026\uB610 \uBC94\uC8C4 \uB4F1 \uC545\uD589\uC744 \uC800\uC9C0\uB974\uACE0\uB3C4 \uD6C4\uD68C\uB098 \uC8C4\uCC45\uAC10\uC774 \uC5C6\uB2E4. \uC989, \uC778\uACA9\uC774\uB098 \uC591\uC2EC\uC758 \uC601\uC5ED\uC778 \u2018\uCD08\uC790\uC544(superego)\u2019\uC5D0 \uBB38\uC81C\uAC00 \uC788\uB294 \uAC83\uC774\uB2E4. \uCD08\uC790\uC544\uC5D0 \uAD6C\uBA4D\uC774 \uB6AB\uB838\uB2E4\uB294 \uB73B\uC73C\uB85C \u2018\uC288\uD37C\uC5D0\uACE0 \uB77C\uCFE0\uB098\u2019\uB77C\uACE0 \uBD80\uB974\uAE30\uB3C4 \uD55C\uB2E4.\"",
