  "text" : "\uC560\uCD08\uC5D0 \uBAB0\uCE74\uBC94\uC8C4 \uC790\uCCB4\uAC00 \uAC15\uB825\uBC94\uC8C4\uC774\uAE30 \uB54C\uBB38\uC5D0, \uBAB0\uCE74\uAC00 \uAC15\uB825\uBC94\uC8C4\uC758 \uC804\uB2E8\uACC4\uB77C\uB294 \uAC00\uC124\uC740 \uC6A9\uC5B4\uC640 \uBC94\uC8FC\uC5D0\uC11C\uBD80\uD130 \uC624\uB958\uAC00 \uC788\uC74C. \uD558\uC9C0\uB9CC \uBC1C\uD654\uC790\uAC00 \"\uACBD\uBC94\uC8C4\uAC00 \uC544\uB2CC \uAC15\uB825\uBC94\uC8C4\uC758 \uC804\uB2E8\uACC4\"\uB77C\uACE0 \uC5B8\uAE09\uD588\uAE30\uC5D0, \uACBD\uBC94\uC8C4\uC640 \uB300\uCE58\uB418\uB294 \uACBD\uC911(\u8F15\u91CD) \uAC1C\uB150\uC73C\uB85C \uD310\uB2E8\uC744 \uD574\uBD24\uB294\uB370- \uADF8\uB798\uB3C4 \uC758\uBB38",
