  "text" : "\uADF8\uB9AC\uACE0 \uBAB0\uCE74\uBC94\uC8C4- \uC989, \uC131\uD3ED\uB825\uBC94\uC8C4\uC758 \uCC98\uBC8C \uB4F1\uC5D0 \uAD00\uD55C \uD2B9\uB840\uBC95\uC5D0\uC11C \uADDC\uC728\uD558\uACE0 \uC788\uB294 '\uCE74\uBA54\uB77C \uB4F1 \uC774\uC6A9 \uCD2C\uC601\uC8C4'\uB294 \uC131\uBC94\uC8C4 \uCE74\uD14C\uACE0\uB9AC\uC5D0 \uD3EC\uD568\uB418\uACE0, \uC131\uBC94\uC8C4\uB294 \uAC15\uB825\uBC94\uC8C4 \uCE74\uD14C\uACE0\uB9AC\uC5D0 \uB4E4\uC5B4\uAC00\uAE30 \uB54C\uBB38\uC5D0 \uBAB0\uCE74\uBC94\uC8C4 \uADF8 \uC790\uCCB4\uAC00 \uAC15\uB825\uBC94\uC8C4. \uC778\uC6A9\uAE00\uC5D0\uC11C \uB9D0\uD55C \uAC15\uB825\uBC94\uC8C4\uC758 \uC758\uBBF8\uB294 \uB2E4\uB978 \uB4EF",
